import React, { useState } from'react';
import './App.css';
import Form from './Components/Form';
import Navbar from './Components/Navbar';
import SkillsList from './Components/SkillsList';
import Login from './Components/Login';
import Registration from './Components/Registration';
import axios from 'axios';

import { BrowserRouter as Router, Switch, Route} from 'react-router-dom';






function App() {
  // State stuff
  const [inputText, setInputText] = useState("");
  const [skills, setSkills] = useState([]);
  // const [logins, setLogins] = useState({});
  const [session, setSession] = useState({auth: false, token:""})

  // Refer to react docs for conditional learning


  return (
    <Router>
      <div className="App">
        <Navbar />

        <Switch>

          <Route path='/' exact>
          <div className='app-container'>
          <h1 className='app-name'>Level Up App</h1>
            <Form inputText={inputText} setInputText={setInputText} skills={skills} setSkills={setSkills} />
            <SkillsList skills={skills} setSkills={setSkills} />
          </div>
          </Route>
          <Route path='/register' component={Registration} />
          <Route path='/login' component={Login} />


        </Switch>

      </div>
    </Router>

  );
}

export default App;
